import { Col, Container, Row } from "react-bootstrap";

export default class Playlist extends Component {
  render() {
    return (
      <Container>
        <Row>
          {/*thumbnail*/}
          <img
            src="https://www.techsmith.com/blog/wp-content/uploads/2021/02/video-thumbnails-hero-1.png"
            alt="Playlist thumbnail"
          />
        </Row>
        <Row>
          {/* Title */}
          Nodejs Tutorial
        </Row>
        <Row>
          {/* Description */}
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque
            vestibulum tristique ante, et luctus turpis. Vestibulum aliquam
            velit mi, ac fermentum leo vulputate eget. Nulla elit tortor,
            ultricies et odio.
        </Row>
        <Row>{/* Hours left */}
                Hours Left: 36
        </Row>
        <Row>{/* Start button */}
            Start
        </Row>
      </Container>
    );
  }
}
